		public Fv_activity Fv_activity
		{
			get
			{
				return this._Fv_activity.Entity;
			}
			set
			{
				Fv_activity previousValue = this._Fv_activity.Entity;
				if (((previousValue != value) 
							|| (this._Fv_activity.HasLoadedOrAssignedValue == false)))
				{
					this.SendPropertyChanging();
					if ((previousValue != null))
					{
						this._Fv_activity.Entity = null;
						previousValue.Fv_debrief.Remove(this);
					}
					this._Fv_activity.Entity = value;
					if ((value != null))
					{
						value.Fv_debrief.Add(this);
						this._Activity_id = value.Id;
					}
					else
					{
						this._Activity_id = default(Nullable<System.Guid>);
					}
					this.SendPropertyChanged("Fv_activity");
				}
			}
		}
		
